import React, { Component } from 'react';
import { Container } from 'semantic-ui-react';
import '../App.css';

class Guideline extends Component {
  render() {
    return (
      <div className='ui container'>

          <h1 id="h1">Guidelines</h1>
          <ol type='I'>
            <li>FOR DONOR</li>

            <li>FOR BENEFICIARY</li>
          </ol>

      </div>
    );
  }
}
export default Guideline
